class ResponseHelper {
  static success(c, data, message, statusCode = 200) {
    const response = {
      success: true,
      message,
      data
    };
    return c.json(response, statusCode);
  }
  static error(c, message, statusCode = 400, errors) {
    if (errors) {
      return c.json({
        success: false,
        message: "Validation failed",
        errors
      }, statusCode);
    }
    return c.json({
      success: false,
      message: message || "Internal Server Error",
      data: null
    }, statusCode);
  }
  static validationError(c, errors, message = "Validation failed") {
    const response = {
      success: false,
      error: message,
      errors
    };
    return c.json(response, 422);
  }
  static paginated(c, data, pagination, message, statusCode = 200) {
    const response = {
      success: true,
      message,
      result: {
        pagination,
        data
      }
    };
    return c.json(response, statusCode);
  }
}

class PaginationHelper {
  static createMeta(page, limit, total) {
    const totalPages = Math.ceil(total / limit);
    return {
      page,
      limit,
      total,
      totalPages
    };
  }
  static validatePaginationParams(page, limit) {
    const validPage = Math.max(1, page || 1);
    const validLimit = Math.min(Math.max(1, limit || 5), 100);
    return { page: validPage, limit: validLimit };
  }
}

